import React from 'react'
import { connect } from 'react-redux'

const logoutButton = props => {
    const logout = () => {
        localStorage.removeItem('token')
        props.dispatch({
            type: 'LOGOUT'
        })
    }
    return(
        <button onClick={logout}>logout</button>
    )
}

const LogoutButton =  connect()(logoutButton)

export { 
    LogoutButton
}
